import React, { Component } from "react";
import { ProductConsumer } from "../context.js";
import { Link } from "react-router-dom";

export default class Details extends Component {
  render() {
    return (
      <React.Fragment>
        <ProductConsumer>
          {value => {
            const {
              id,
              company,
              img,
              info,
              price,
              title,
              inCart
            } = value.detailProduct;
          }}
        </ProductConsumer>
      </React.Fragment>
    );
  }
}
